import React, { useState, useEffect } from 'react';
import useWebSocket from 'react-use-websocket';

const TagForm = () => {
  const [currentTag, setCurrentTag] = useState('Loading...');

  const socketUrl = 'ws://localhost:8082/';
  const { lastMessage, readyState } = useWebSocket(socketUrl);

  useEffect(() => {
    if (lastMessage !== null) {
      const data = JSON.parse(lastMessage.data);
      setCurrentTag(data.tag); // Assuming data.tag is the identification of the RFID tag
    }
  }, [lastMessage]);

  return (
    <div>
      <h1>RFID Tags Viewer</h1>
      <p id="currentTag">Current RFID Tag: {currentTag}</p>
      {/* Input field to display RFID tag identification */}
      <input type="text" value={currentTag} readOnly />
    </div>
  );
};

export default TagForm;
